import React, { useContext } from 'react';
import Card from './Card';


const MapCard = (value) => {
    const category = useContext();
     <category.Provider>
          return(
        <Card 
        imgsrc={value.imgsrc}
        key={value.Id}
        brand = {value.brand} 
        detail = {value.detail}
        price={value.price}
    /> );


     </category.Provider>


};

export default MapCard;
